import React from "react";
import '../Components/Overlay.css'

function Overlay() {
  return <div>
    <div className="search-box">
        <input className="search" type="text" placeholder="Search..."/>
        <img src="../Components/search.png" alt="" />
    </div>
  </div>;
}

export default Overlay;
